    [JSInvokable("TDAStreamerStatus")]
    public void TDAStreamerStatus(string it)
    {
        switch (it)
        {
            case "0": status = "CONNECTING"; break;
            case "1": status = "OPEN"; break;
            case "2": status = "CLOSING"; break;
            case "3": status = "CLOSED"; break;
        }
